INSERT INTO `journal_encounter_section_locale` (`ID`, `locale`, `Title_lang`, `BodyText_lang`, `VerifiedBuild`) VALUES
(30861, 'ptBR', 'Causadores de Dano', '$bullet; Incendiários precisam ser atraídos para longe do raide. A explosão da |cFF2959D3|Hspell:464983|h[Tocha]|h|r é grande e causa dano elevado.\n$bullet; Flamívagos lançam |cFF2959D3|Hspell:470164|h[Infusão de Magma]|h|r até serem derrotados, o que dificulta o deslocamento pelo Salão de Ferro.\n$bullet; Os jogadores precisam destruir âncoras do portal o mais rápido possível, enquanto impedem que os Espíritos Incandescentes lancem |cFF2959D3|Hspell:464769|h[Fúria das Terras do Fogo]|h|r.', 57534),
(30900, 'ptBR', 'Visão Geral', 'O Imperador Dagran Thaurissan e a Princesa Moira Barbabronze são combatentes formidáveis. A |cFF2959D3|Hspell:466504|h[Palavra Sombria: Nêmesis]|h|r e a |cFF2959D3|Hspell:470599|h[Palavra Sombria: Necrose]|h|r de Moira precisam ser gerenciadas com cautela, ou sobrepujarão o raide. Moira tentará curar Dagran com |cFF2959D3|Hspell:470605|h[Infusão Radiante]|h|r. \n\nDagran é um combatente corpo a corpo perigoso, que não hesitará em |cFF2959D3|Hspell:465077|h[Convocar a Guarda Imperial]|h|r e |cFF2959D3|Hspell:465079|h[Convocar Embaixadores do Martelo do Crepúsculo]|h|r para repelir os invasores. Quando Moira for derrotada, Dagran se transformará num poderoso |cFF2959D3|Hspell:465069|h[Avatar de Chamas]|h|r, fortalecendo todas as próprias habilidades.\n\nQuando se desesperar, Dagran decidirá |cFF2959D3|Hspell:466332|h[Rogar ao Senhor do Fogo]|h|r para que o salve. A devastação do Avatar de Ragnaros consumirá todo o recinto com fogo derretido até que Dagran seja derrotado. Dagran não convocará mais a Guarda Imperial nem os Embaixadores do Martelo do Crepúsculo depois que Ragnaros entrar na batalha.', 57534),
(31073, 'ptBR', '', '', 57534),
(30986, 'ptBR', 'Seção 24', '', 57534),
