(30887, 'ptBR', 'Espírito Incandescente', '', 57534),
(30722, 'ptBR', 'Visão Geral', 'Lorde Pétror lança |cFF2959D3|Hspell:462351|h[Magma Inundante]|h|r no alvo, causando dano e fornecendo matéria-prima para |cFF2959D3|Hspell:463674|h[Cristalizar]|h|r sua prole obsidiana.\n\nQuando chega a 95% dos pontos de vida e a cada 20% de dano sofrido depois disso, Lorde Pétror lança |cFF2959D3|Hspell:462322|h[Erupção]|h|r, enchendo o ambiente de |cFF2959D3|Hspell:462351|h[Magma Inundante]|h|r. Cada |cFF2959D3|Hspell:462346|h[Magma Vivo]|h|r que atinge o destino aumenta o poder do elemental criado por |cFF2959D3|Hspell:462320|h[Cristalização Ígnea]|h|r.\n\nQuando alcança 100 de energia, Pétror lança |cFF2959D3|Hspell:462317|h[Revolta Vulcânica]|h|r, causando muito dano a todos os jogadores.', 57534),
(5499, 'ptBR', 'Fissura Inferior de Sombra', 'O Grão-bruxo Maléter cria uma fissura de Consumição sob um jogador, causando $30498s1 de dano de Sombra a cada $30498t1 s enquanto o jogador estiver dentro dela.', 57534),
