(4910, 'ptBR', 'Salva', 'Illyanna Corvalho atira uma salva de flechas em todos os jogadores numa área de $30933A1 m de largura. A salva causa $448891s1 de dano Arcano a cada $448891t1 s por $30933d.', 57534);
